import { Link, Typography } from "@material-ui/core";

export default function Customer({ customer }) {
  console.log(customer);
  return (
    <React.Fragment>
      <Typography variant="body1">{customer?.name}</Typography>
      <Typography variant="body2" color="textSecondary">
        {customer?.phone}
      </Typography>
      <Typography variant="body2" color="textSecondary">
        {customer?.address}
      </Typography>
    </React.Fragment>
  );
}
